import { __decorate } from "tslib";
import { singleton } from 'mana-syringe';
import { parseFilter } from '../parser';

var CSSPropertyFilter =
/** @class */
function () {
  function CSSPropertyFilter() {
    this.parser = parseFilter;
  }

  CSSPropertyFilter = __decorate([singleton()], CSSPropertyFilter);
  return CSSPropertyFilter;
}();

export { CSSPropertyFilter };
